IF OBJECT_ID('dbo.proc_transform_145', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_145;
GO
CREATE PROCEDURE dbo.proc_transform_145
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_145
    SET payload = LEFT(payload, 1000) + N'|V4-145|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_145;
END
GO
IF OBJECT_ID('dbo.audit_v4_145', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_145 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_145;
GO

CREATE INDEX IDX_staging_145_payload ON dbo.staging_table_145 (id);
